import React from "react";
import TodoItem from "./TodoItem";

const TodoList = ({ filtered, removeItem, IndexOfLastTodo, indexOfFirstTodo, editItem, setShowInput, showInput }) => {
    return (
        <div className="todoList">
            {filtered.map((todo) => (
                <div key={todo.id}>
                    <TodoItem
                        removeItem={removeItem}
                        todo={todo}
                        editItem={editItem}

                        setShowInput={setShowInput}
                        showInput={showInput}
                    />
                </div>
            ))}
        </div>
    );
};

export default TodoList;
